window.bookSummaryJSON = "<p>A ragtag crew of humans and posthumans discover alien technology that could change the fate of humanity...or awaken an ancient evil and destroy all life in the galaxy.</p> <p>The shady crew of the White Raven run freight and salvage at the fringes of our solar system. They discover the wreck of a centuries-old exploration vessel floating light years away from its intended destination and revive its sole occupant, who wakes with news of First Alien Contact.</p> <p>When the crew break it to her that humanity has alien allies already, she reveals that these are very different extra-terrestrials...and the gifts they bestowed on her could kill all humanity, or take it out to the most distant stars.</p>"; 
